css:
@-moz-document domain("forum.doom9.org") {
body {
    background: #151515;
    color: #777777;
}
.page {
    background: #151515;
    color: #777777;
}
.alt1,
.alt1Active {
    background: #151515;
    color: #777777;
    border: 1px solid rgba(50, 50, 50, 1)!important;
}
.alt2,
.alt2Active {
    background: #050505;
    color: #777777;
    border: 1px solid rgba(50, 50, 50, 1)!important;
}
.vbmenu_control {
    background: #337ab7;
    color: #151515;
}
.tborder {
    background: #151515;
    color: #777777;
    border: 1px solid #777777;
}
.tcat {
    background: #337ab7;
    color: #000000;
}
.thead {
    background: #151515;
    color: #777777;
}
td.thead,
th.thead,
div.thead {
    border: 1px solid rgba(50, 50, 50, 1)!important;
}
hr {
    border: 1px solid rgba(50, 50, 50, 1)!important;
}
div#posts {
    border: 1px solid rgba(50, 50, 50, 1)!important;
}
.tfoot {
    background: #337ab7;
}
}
